 let newProducts= ()=>{
    axios('https://fakestoreapi.com/products',{
        method:"POST",
        body:JSON.stringify(
            {
                title: 'test product',
                price: 13.5,
                description: 'lorem ipsum set',
                image: 'https://i.pravatar.cc',
                category: 'electronic'
            }
        )
    })
        .then(res=>res.json())
        .then(json=>console.log(json))
}
function Cakedetails(props){
var params = useParams(props)
    return(
        <>
        <h1>CakeDETAILS {params.cakeid}</h1>
        <button onClick={newProducts}>clicck products</button>
        </>

    )
}
export default Cakedetails
